import React from 'react';

class Menu extends React.Component {
  constructor(props) {
    super(props);
    this.name = props.name;
    this.type = props.type;
    this.title = props.title;
    this.info = props.info;
    this.highlight = props.highlight;

    if (this.name == "") {
      this.name = "blank";
    }
  }

  render() {
    return (
      <div className="tourney-menu">
        <div>{this.name}</div>
        <form>
          <div>
          <input type="radio" name="blank" value="blank" />
          Blank
          </div>
          <input type="radio" name="text" value="text" />
          <input type="radio" name="timer" value="timer" />
        </form>
        <div>{this.type}</div>
        <div>{this.title}</div>
        <div>{this.info}</div>
        <div>{this.highlight}</div>
      </div>
    )
  }
}

export default Menu;
